李江华，男，1965年3月出生，汉族，海南乐东人，1982年11月参加工作，1987年10月加入中国共产党，中央党校研究生学历。
现任中共临高县委书记(正厅级)。
简历
1982.11——1986.09，海南黎族苗族自治州税务局办事员(其间：1983.09—1986.07广东广播电视大学海南自治州分校商业企业管理专业学习);
1986.09——1988.01，海南黎族苗族自治州团委青运史研究室负责人、宣传部负责人;
1988.01——1989.09，共青团海南省三亚市委宣传部负责人;
1989.09——1991.06，共青团海南省三亚市委宣传部副部长(其间：1990.04—1991.04在三亚市红旗镇委挂职锻炼任副书记);
1991.06——1993.10，共青团海南省三亚市委副书记;
1993.10——1998.04，共青团海南省三亚市委书记(其间：1995.08—1997.12在中央党校函授学院经济管理专业研究生学习);
1998.04——1998.08，海南省三亚市委委员、共青团三亚市委书记;
1998.08——2004.12，共青团海南省委副书记(其间：2003.05—2004.12在国家开发银行信用管理局挂职任副局长);
2004.12——2006.09，海南省委统战部副部长;
2006.09——2010.02，海南省五指山市委书记(副厅级);
2010.02——2010.03，海南省儋州市委副书记、代市长(正厅级);
2010.03——2011.11，海南省儋州市委副书记、市长(正厅级)。
2011.11——海南省临高县委书记

陈英文，男，汉族，广东佛山人，1972年8月出生，1994年7月参加工作，1993年5月加入中国共产党，党校本科学历，工程硕士。区委副书记、区长、区政府党组书记，兼任三水新城管委会主任，三水工业园区管委会党组书记、主任，主持区政府全面工作。

1991.09－1994.07　佛山大学应用化学专业学习；
1994.07－1995.07　南海市环保局科员;
1995.07－1996.12　南海市环保局综合科副科长，驻狮山开发区建委工作科副科长、办公室副主任;
1996.12－1999.03　南海市环保局办公室主任（其间：1998.08－1999.03　在南海市松岗镇、南庄镇挂职，任镇长助理、建设办主任）;
1999.03－2001.11　共青团南海市委副书记（其间：1997.09－2000.07　在广东省委党校现代企业管理专业学习）;
2001.11－2003.08　南海区（市）和顺镇党委委员;
2003.08－2005.01　南海区和顺镇党委副书记;
2005.01－2006.11　南海区里水镇党委副书记、镇长;
2006.11－2007.01　南海区里水镇党委书记、镇长;
2007.01－2010.11　南海区里水镇党委书记（其间：2007.09－2009.07　攻读武汉大学工程硕士学位）;
2010.11－2011.05　南海区副处级干部，里水镇党委书记；
2011.05－2011.09　南海区副处级干部，狮山镇党委书记;
2011.09－2011.11　三水区委副书记、代区长、区政府党组书记;
2011.11－2011.12　三水区委副书记、区长、区政府党组书记;
2011.12－2012.06　三水区委副书记、区长、区政府党组书记，兼任三水新城管委会主任;
2012.06－现在　　 三水区委副书记、区长、区政府党组书记，兼任三水新城管委会主任，三水工业园区管委会党组书记、主任。

张火青，男，1963年12月出生，湖北汉川人，汉族，1981年11月参加工作，1996年10月加入中国共产党，学历研究生(武汉水利电力大学河流工程系工程水文与水资源专业)，工学博士，高级工程师。现任增城区委书记。
1979年9月至1981年11月，在长江水电水利学校学习;
1981年11月至1992年9月，任水利部长江水利委员会技术员、助理工程师、工程师(其间：1983年9月至1988年7月，在南京河海大学陆地水文专业学习);
1992年9月至1997年3月，在武汉水利电力大学河流工程系工程水文学及水资源专业研究生学习;
1997年3月至2000年3月，任广州市水利局三防办、科教处主任科员(其间：1999年5月至2000年3月，挂任市水利水电勘测规划设计院副院长);
2000年3月至2001年8月，任广州市防汛防旱防风总指挥部办公室副主任;
2001年8月至2002年1月，任广州市水利局科教规划处副处长;
2002年1月至2003年4月，任广州市科学技术局副局长、党组成员;
2003年4月至2006年9月，任广州市天河区副区长(其间：2003年12月至2006年9月，兼任广州高新技术产业开发区天河科技园管委会党委书记);
2006年9月至2007年3月，任广州市白云区委常委、副区长;
2007年3月至2010年8月，任广州市政府副秘书长、办公厅党组成员;
2010年8月至2010年12月，任广州市黄埔区委副书记、副区长、代区长;
2010年12月至2015年6月，任广州市黄埔区委副书记、区长;
2015年6月至2015年9月，任广州市黄埔区区长;
2015年9月后，任现职。

臧建中，男，1960年6月出生，汉族，江苏常州人，党校函授本科学历，1980年4月参加工作，1980年4月加入中国共产党。现任中共武进区委副书记，武进区人民政府党组书记、区长。
1980年4月起任武进县龙虎塘公社安基大队副大队长;
1982年10月起任武进县龙虎塘公社团委书记;
1983年7月起任武进县新桥区工委专职团干部;
1984年8月起任共青团武进县委青农部部长;
1985年1月起任共青团武进县委副书记;
1989年3月起任武进县薛家乡党委副书记;
1989年5月起任武进县薛家乡乡长;
1992年4月起任共青团常州市委员会副书记、常州市青年联合会主席;
1995年7月起任常州高新技术产业开发区管委会副主任(其中1995年9月起任常州市人民政府新区管理委员会党工委委员);
1996年11月起任常州市人民政府新区管理委员会副主任(其中1999年11月起任常州市高新技术产业开发区管委会副主任、党工委委员);
2002年4月起任常州市高新技术产业开发区党工委副书记、新北区党委副书记、新北区政府筹备组成员(其中2002年10月起兼任常州市高新技术产业开发区纪委书记、新北区纪委书记、政法委书记，2003年10月起兼任新北区春江镇党委书记);
2006年2月起任中共武进区委副书记(正处级，其中2006年2月至2009年1月兼任武进区纪委书记);
2011年5月起任武进区人民政府党组书记、副区长、代区长；
2012年3月起任武进区区长。
2016年1月起任区人大常委会主任。

蔡澍，男，1973年9月出生，汉族，湖南省益阳市人，1994年7月参加工作，1993年11月加入中国共产党，在职研究生学历，管理学硕士学位。现任中共从化市委副书记、市人民政府市长、党组书记。
1990年9月至1994年7月西北轻工业学院皮革工程专业大学本科毕业;
1994年7月在广州人民制革厂工作，任助理工程师;
1996年1月在广州平安保险公司工作，任业务经理;
1998年4月在共青团广州市委工作，任学校部科员;
1998年12月在共青团广东省委工作，先后任宣传部科员、副主任科员、主任科员，
2002年10月任团省委办公室副主任，
2004年9月任团省委城乡部部长，
2005年1月任团省委常委，
2005年7月任团省委学校少年部部长;
2007年4月任佛山市委组织部副部长(正处级，其间：2007年6月至2008年1月挂任南海区委常委);
2010年11月任广州市政协办公厅副局级秘书;
2011年8月任从化市委常委(广州市副局级)，
2011年9月任从化市委常委，市政府常务副市长、党组副书记;
2013年4月任从化市委副书记，市政府代理市长、党组书记;
2013年7月任从化市委副书记，市政府市长、党组书记；
2006年9月至2009年7月华南理工大学行政管理专业研究生毕业，获管理学硕士学位。
